#puzzle_input
one =''
two = ''
three = ''
four = ''
five = ''

lines = [one,two,three,four,five]
def new_number(on_number,direction):
    numpad = {1 : {'R':2,'L':0,'D':4,'U':0},
              2 : {'R':3,'L':1,'D':5,'U':0},
              3 : {'R':0,'L':2,'D':6,'U':0},
              4 : {'R':5,'L':0,'D':7,'U':1},
              5 : {'R':6,'L':4,'D':8,'U':2},
              6 : {'R':0,'L':5,'D':9,'U':3},
              7 : {'R':8,'L':0,'D':0,'U':4},
              8 : {'R':9,'L':7,'D':0,'U':5},
              9 : {'R':0,'L':8,'D':0,'U':6},
    }
    number = numpad[on_number][direction]
    if number == 0:
        return on_number
    else:
        return number

#find number, just typing numbers from printed output
list_of_nums = []
for line in lines:
    num = 5
    for direction in line:
        num = new_number(num,direction)
    list_of_nums.append(num)
print(list_of_nums);
